import MenuButtons from './MenuButtons';
import TextInput from './TextInput';

const Menu = () => {

    const backgroundStyle = {
        position: 'absolute',
        top: 0,
        left: 0,
        height: 'auto',
        width: '400px',
        zIndex: 0,
    };

    return (
        <div id="menu-container">
            <input id="cat-name" type="text" placeholder="Enter Kitten Name" maxlength="15"/>
            <MenuButtons></MenuButtons>
            <img id="background" src="/imgs/Notebook Menu.png" style={backgroundStyle} draggable="false" alt=""/>
        </div>
    );
};
export default Menu;
